import React from 'react';
import './Project.css';
impo

function Project() {
  return (
    <div className='projects'>
        <div className="project-title">
            <h1>Projects</h1>
        </div>
        <div className="project-all" >
            {proimg.map((h,id)=>{
                <img key={h.id} src={h.img } alt=''/>
                })}
        </div>
    </div>
  )
}

export default Project
